class Nav extends Component {
    render() {
        return (
            <nav class="navbar navbar-expand-lg navbar-light bg-light nav justify-content-center">
               
                    
                        <a class="nav-link active" href="#">Active</a>
                    <img src="/img/img_logo/restaurant10.jpg" />
                
            </nav>
        )
    }
}
export default Nav;
